(8, 'gold investment plan', 'this is very good products .', 18, 54000.00, '', '2025-09-10 05:07:19', '2025-09-10 05:07:19'),
(11, 'Swarna Suraksha Yojana - 3000', '\n\n1. The customer must pay 3000 every month for a total of 9 months.\n2. Total savings of 27,000 will be converted to gold jewellery at the prevailing gold rate on the scheme completion date.\n3. No cash refund will be provided  redemption is only in the form of gold jewellery.\n4. Appreciation gifts will be given only to customers who complete all payments.\n5. The terms of the scheme may be revised as per company policy.\n6. Valid ID proof is required to enroll, and receipts will be issued for every payment.\n7. The design and weight of jewellery will be based on available stock and customer preference.\n8. Gold purity will be 22K BIS Hallmarkedonly.\n\n\n', 9, 3000.00, 'publish', '2025-09-23 05:41:49', '2025-09-23 07:01:14'),
(12, 'Gold Diamond Scheme', '\n\n Silver Diamond Scheme: Save, Play, and Win Luxurious Prizes! \nThis exclusive 6-month scheme allows you to win exciting monthly prizeswhile building savings. Here\'s how it works:\n\n Key Details\nDuration:\n\nThe scheme runs from 1st April to 1st September.\nMonthly Contribution: 1000 per month.\n\nRecurring Payment Dates:\n\nYour first payment is charged immediately upon subscribing.\nSubsequent payments are automatically scheduled for the 1st of each month:\n\n1st May\n1st June\n1st July\n1st August\nEnds on 1st September.\n\n\n\n\n Exciting Prizes\n\nMonthly Winner Announcements:\n\nEvery month, winners are announced and awarded luxurious prizes like:\n\nStylish bike\nExquisite gold jewelry\nStunning diamond set\n\n\nTerms for Winners:\n\nIf you win a prize during a monthly draw, you can exit the scheme and no longer pay the remaining recurring payments.\nNon-winning participants continue their subscription and remain eligible for future draws.\n\n\n\n\nGrand Mega Prize in the Final Month:\n\nIn September, winners of all remaining prizes and the grand prizea luxurious brand-new carwill be announced.\nParticipants who complete all 6 payments are automatically entered into the final draw.\n\n\n\n\n Payment &amp; Participation Details\n\nParticipation Fee: 1000 per month.\nPayment Methods:\n\nUPI\nDebit/Credit Cards\nNet Banking\n\n\nRecurring Payments: Securely deducted on the 1st of each month.\n\n\n Subscription Number\n\nAfter your first payment, you will receive a unique Subscription Number.\nThis number serves as your entry into the lucky draw for all prizes.\n\n\n Winner Announcements\n\nMonthly Winners:\n\nWinners are declared via a live event and announcements on our website and social media.\nParticipants are notified via email and SMS.\n\n\nFinal Month Mega Draw:\n\nAll remaining prizes and the grand prize (a brand-new car) will be awarded in September.\n\n\n\n\n Terms &amp; Conditions\n\nRecurring Payments:\n\nParticipants must pay 1000/month to remain eligible for prizes until they win a prize or the scheme ends.\n\n\nWinners Exit Option:\n\nMonthly prize winners can opt-out of the scheme and stop future payments.\n\n\nEligibility for Final Draw:\n\nOnly participants who complete all 6 payments are eligible for the grand prize in September.\n\n\nUnique Order Number:\n\nA unique order number is generated for each payment and cannot be modified.\n\n\nRandom Selection:\n\nWinners are selected randomly and fairly using subscription numbers.\n\n\nNon-Refundable:\n\nParticipation fees are non-refundable under any circumstances.\n\n\nDisqualification:\n\nIncomplete payments or invalid details result in disqualification.\n\n\n\n\n How to Participate\n\nSubscribe to the Silver Diamond Scheme on our website.\nMake your first payment of 1000 to secure your entry.\nStay eligible by ensuring recurring payments on the 1st of each month.\n\n Why Wait? Start Saving and Winning Today! \n Join the Silver Diamond Scheme Now! \n\n\n', 6, 1000.00, 'publish', '2025-09-23 05:41:49', '2025-09-23 07:01:15'),
(13, 'Monthly Installment Rs 15,000', 'Introducing the SuperGold Scheme from Vijay Abharna Jewellers  a meticulously designed gold savings plan that helps you accumulate gold smartly while enjoying substantial benefits on your jewelry purchases.\nKey Features and Benefits:\n\nMonthly Installment: 15,000\nTotal Amount Invested: 1,65,000 (for 11 months)\nMaturity Amount: 1,95,000\n\nWith the SuperGold Scheme, you pay only for 11 months, contributing 15,000 each month, for a total investment of 1,65,000. On the 12th month, Vijay Abharna Jewellers pays the last installment for you, bringing the maturity amount to 1,95,000.\nThis means your savings grow significantly, offering you more value and purchasing power for your jewelry needs. At maturity, you can choose either the accumulated amount or equivalent jewelry, ensuring maximum flexibility to meet your preferences.\nStart your gold savings journey today with the SuperGold Scheme and enjoy unmatched benefits for your future jewelry investments. Vijay Abharna Jewellers ensures you get the best value, making your gold investment journey both rewarding and convenient.\n', 11, 15000.00, 'publish', '2025-09-23 05:41:49', '2025-09-23 07:01:15'),
(14, 'Monthly Installment Rs 10,000', 'Introducing the SuperGold Scheme from Vijay Abharna Jewellers  a thoughtfully designed gold savings plan to help you accumulate gold smartly while enjoying exceptional benefits on your jewelry purchases.\nKey Features and Benefits:\n\nMonthly Installment: 10,000\nTotal Amount Invested: 1,10,000 (for 11 months)\nMaturity Amount: 1,30,000\n\nWith the SuperGold Scheme, you pay 10,000 monthly for just 11 months, totaling 1,10,000. On the 12th month, Vijay Abharna Jewellers contributes the final installment for you, bringing the maturity amount to 1,30,000.\nThis unique scheme not only grows your savings but also enhances your purchasing power. At maturity, you can choose between the accumulated amount or equivalent jewelry, ensuring a tailored experience to meet your needs.\nStart your journey with the SuperGold Scheme today and make your gold savings more rewarding. With Vijay Abharna Jewellers, your future jewelry purchases are both convenient and value-packed.\n', 11, 10000.00, 'publish', '2025-09-23 05:41:49', '2025-09-23 07:01:15'),
(15, 'Monthly Installment Rs 5,000', 'Introducing the SuperGold Scheme from Vijay Abharna Jewellers  a meticulously crafted gold savings plan to help you accumulate gold effortlessly while enjoying exceptional benefits on your jewelry purchases.\nKey Features and Benefits:\n\nMonthly Installment: 5,000\nTotal Amount Invested: 55,000 (for 11 months)\nMaturity Amount: 65,000\n\nWith the SuperGold Scheme, you contribute 5,000 monthly for just 11 months, totaling 55,000. On the 12th month, Vijay Abharna Jewellers pays the final installment for you, increasing your maturity amount to 65,000.\nThis plan is a smart and rewarding way to save for future jewelry purchases. At maturity, you have the flexibility to opt for the accumulated amount or equivalent jewelry, ensuring the best value for your investment.\nStart your gold savings journey today with the SuperGold Scheme and enjoy unparalleled benefits for your future jewelry investments. Vijay Abharna Jewellers  making your gold dreams come true!\n', 11, 5000.00, 'publish', '2025-09-23 05:41:49', '2025-09-23 07:01:15'),
(16, 'Monthly Installment Rs 3000', 'Introducing the SuperGold Scheme from Vijay Abharna Jewellers  a thoughtfully designed gold savings plan to help you accumulate gold effortlessly while enjoying significant benefits on your jewelry purchases.\nKey Features and Benefits:\n\nMonthly Installment: 3,000\nTotal Amount Invested: 33,000 (for 11 months)\nMaturity Amount: 39,000\n\nWith the SuperGold Scheme, you contribute 3,000 monthly for just 11 months, totaling 33,000. On the 12th month, Vijay Abharna Jewellers pays the final installment for you, raising the maturity amount to 39,000.\nThis scheme is an ideal way to save for future jewelry purchases, providing you with greater value and flexibility. At maturity, you can choose between the accumulated amount or equivalent jewelry, ensuring a rewarding investment.\nStart your savings journey today with the SuperGold Scheme and let Vijay Abharna Jewellers help you achieve your gold goals with ease and value.\n', 11, 3000.00, 'publish', '2025-09-23 05:41:49', '2025-09-23 07:01:15'),
(17, 'Monthly Installment Rs 1,500', 'Introducing the SuperGold Scheme from Vijay Abharna Jewellers  a perfectly designed gold savings plan to help you accumulate gold effortlessly while enjoying exclusive benefits on your jewelry purchases.\nKey Features and Benefits:\n\nMonthly Installment: 1,500\nTotal Amount Invested: 16,500 (for 11 months)\nMaturity Amount: 19,500\n\nWith the SuperGold Scheme, you contribute 1,500 monthly for 11 months, totaling 16,500. On the 12th month, Vijay Abharna Jewellers pays the last installment for you, increasing your maturity amount to 19,500.\nThis plan is a smart and convenient way to save for future jewelry purchases, providing additional value and flexibility. At maturity, you can choose between receiving the accumulated amount or equivalent jewelry, ensuring your needs are met.\nStart your gold savings journey today with the SuperGold Scheme and let Vijay Abharna Jewellers make your gold investment rewarding and hassle-free!\n', 11, 1500.00, 'publish', '2025-09-23 05:41:49', '2025-09-23 07:01:15');
